import "./all.css"
import Instrument from "./instrument";
function Set(){
    return(
        <div className="set">
            <Instrument class={"drum w"} text={"W"}></Instrument>
            <Instrument class={"drum a"} text={"A"}></Instrument>
            <Instrument class={"drum s"} text={"S"}></Instrument>
            <Instrument class={"drum d"} text={"D"}></Instrument>
            <Instrument class={"drum j"} text={"J"}></Instrument>
            <Instrument class={"drum k"} text={"K"}></Instrument>
            <Instrument class={"drum l"} text={"L"}></Instrument>
         </div>
    )
}
export default Set;
